Kafedrada ilmiy malakali kadrlarni tayyorlash ishlari.
Kafedrada malakali kadrlarni tayyorlash masalalariga alohida e’tibor qaratilgan. 2013 yili dekabr oyida Sh. Yadgarov TATU qoshidagi PKQT va UM tarmoq markazida "Kompyuter texnologiyalari va informatika" yunalishida o'z malakasini oshirib keldi.

FAKULTET HAQIDA
Fakultet ma’muriyati
Fakultet dekanining talabalar bilan ishlash borasidagi lavozim vazifalari: • Fakultet dekanatining faoliyatini va xodimlarini umumiy boshqarish; • Fakultetda malakali mutaxassis kadrlar tayyorlashni ta’minlash, o‘quv-uslubiy, ilmiy, ma’naviy-ma’rifiy ishlarga bevosita rahbarlik qilish, davlat ta’lim standartlari, o‘quv rejalar, o‘quv dasturlar bajarilishini ta’minlash; • O‘quv mashg‘ulotlarini o‘tkazish jadvallari tuzishni tashkil etish va bajarilishini nazor
... 
